import React, { Component } from 'react';
class UserOptionPage extends Component {
    constructor(props){
        super(props);
        console.log(props);
    }
    render() { 
        return ( 
            <div className="container">
                <div className="row justify-content-center" style={row_styles}>
                    <button className="btn btn-primary mt-auto" style={btn_styles}></button>
                </div>
                <div className="row justify-content-center" style={row_styles}>
                    <button className="btn btn-primary mt-4" style={btn_styles}></button>
                </div>
            </div>
         );
    }
}
const container_styles ={
    padding: "40%"
}
const row_styles = {
    height:"100px",
    
}
const btn_styles = {
    "width" : "30%",
    "height" : "60%"
}
 
export default UserOptionPage;
